const Roomlist = ({ rooms }) => {
    return (
      <div className="room-list">
        {rooms.map(room => (
          <div className="room-preview" key={room.id} >
            <h2>{ room.title }</h2>
            <p>Written by { room.author }</p>
          </div>
        ))}
      </div>
    );
  }
   
  export default Roomlist;
